import ExpenseItem from "./Components/ExpenseItem";

function App() {
  const expenses = [
    { Date: new Date(2022, 10, 17), Title: "Car Insurance", Amount: 458.96 },
    { Date: new Date(2022, 10, 16), Title: "Food", Amount: 1858.96 },
    { Date: new Date(2022, 10, 15), Title: "Rent", Amount: 590.96 },
    { Date: new Date(2022, 10, 14), Title: "Gym", Amount: 128.96 },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
